import "../App.css";
import React, { useEffect } from "react";
import Loading from "../Components/Loading";

function Forecast(props) {
  console.log(props.forecast[0].logo);
  return (
    <div>
      <div>
        <Loading />
      </div>
      <div style={props.background} className="Background"></div>
      <div className="forecast">
        <div
          className="tomorrow"
          style={{ backgroundImage: "url(/clearLogo,png)" }}
        ></div>
        <div className="futureDays"></div>
      </div>
    </div>
  );
}

export default Forecast;
